import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Box, Button, Typography } from '@mui/material';
import { Container, Row, Col } from 'react-bootstrap';

function Home() {
  const navigate = useNavigate();

  return (
    <div
      style={{
        backgroundImage: 'url(/home 1.jpeg',  // Ganti dengan path gambar Anda
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        height: '100vh',  // Menjamin tinggi halaman penuh layar
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        color: 'white',  // Warna teks
        position: 'relative',  // Untuk menempatkan elemen di atas background
      }}
    >
      <Container>
        <Row className="justify-content-center">
          <Col xs={12} md={8} lg={6} className="text-center">
            <h1>Identifikasi Penyakit Padi</h1>
            <p>Dengan menggunakan teknologi AI untuk mendiagnosis penyakit pada tanaman padi</p>
          </Col>
        </Row>
      </Container>

      <Box
      sx={{
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
        textAlign: 'center',
        backgroundImage: 'url(/path-to-paddy-image.jpg)', // Ganti dengan path yang sesuai
        backgroundSize: 'cover',
        backgroundPosition: 'center',
      }}
    >
      <Typography variant="h3" sx={{ color: '#fff', mb: 4 }}>
        Sistem Identifikasi Penyakit Padi
      </Typography>
      <Box sx={{ display: 'flex', gap: 2 }}>
        <Button variant="contained" onClick={() => navigate('/register')}>Register</Button>
        <Button variant="contained" onClick={() => navigate('/login')}>Login</Button>
        <Button variant="outlined" onClick={() => navigate('/diagnosis')}>
          Lanjutkan Tanpa Login
        </Button>
      </Box>
    </Box>
    </div>

    
  );
}

export default Home;
